B.y3=new A.bJ("LTE","Fixes for Huawei E3372","### Previous release broke support for Huawei E3372. This issue is now resolved.")
B.yd=new A.bJ("Android platform","Boot time improvements","### Version 2022.44.1 includes multiple internal optimisations that allow for your Tesla Android to boot up faster after the car wakes from sleep.")
B.yc=new A.bJ("Virtual display","Performance and quality improvements","### Virtual display resolution has been increased to enable high fidelity Android experience in your Tesla.\n### The responsiveness is also improved thanks to internal changes in the video layer.")
B.xQ=new A.bJ("CarPlay","Performance improvements","### Improvements in the video layer leave more performance for other components.\n### Decoding video stream from CarPlay is faster in version 2022.44.1.")
